import React from "react";
import {Text, StyleSheet, View, Button, TouchableOpacity} from "react-native";
import Contant from "./Contant";

const HomeScreen = ({navigation}) => {
  return (
    <View>
      <Text style={styleText.textStyle}>My website</Text>
      <Button
        onPress={() => {
          console.log(navigation.navigate("Components"));
        }}
        title="GO to Component"
      />
      <Button
        onPress={() => {
          console.log(navigation.navigate("List"));
        }}
        title="GO to List"
      />
      <Button
        onPress={() => navigation.navigate("Images")}
        title="Go to Images"
      />
    </View>
  );
};

const styleText = StyleSheet.create({
  textStyle: {
    color: "blue",
    fontSize: 25,
    textAlign: "center",
    backgroundColor: "black",
    height: 65,
    padding: 12,
  },
  buttonStyle: {
    color: "black",
    textAlign: "center",
    padding: 12,
    fontSize: 25,
  },
});

export default HomeScreen;
